import React, { Component } from "react";

class Weather extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div class="bg">
        <div class="container">
          <div class="row">
            <h1 class="text-center">
              Local Weather
              <br />
              Report
            </h1>
          </div>
          <div class="row text-center">
          <div class="border col-md-offset-4 col-md-4 col-sm-offset-3 col-sm-6 col-xs-offset-1 col-xs-10">
          <div class="row" id="location"></div>
          <p class="hor-line"></p>
          <div class="row">
            <div class="col-xs-6 col-ms-6 text-center">
              <div id="date"></div>
            </div>
            <div class="col-xs-6 col-ms-6 text-center">
              <div id="time"></div>
            </div>
          </div>
          </div>
          </div>




        </div>
      </div>
    );
  }
}

export default Weather;
